import { Box, Center, Container, HoverCard } from "@mantine/core";
import React from "react";
import { IconAlignLeft, IconSearch } from "@tabler/icons-react";
const AppBar = () => {
  return (
    <div>
      <Container fluid bg="var(--mantine-color-blue-light)">
        <Center>App Bar</Center>
      </Container>
      <Box my-2>
        <div className="justyfi-betwen">
          <IconAlignLeft />
          <IconSearch />
        </div>
      </Box>
    </div>
  );
};

export default AppBar;
